  # Find a match in WDRS or keep_na
  match_in_wdrs_keep_na() %>%
  # Split SEQUENCE_ACCESSION for partial matching
  tweak_gisaid_id(.$SEQUENCE_ACCESSION)

fuzzy_count <- fuzzy_df %>%
  filter(in_wdrs == 0 & in_keep_na == 0) %>%
