# Counts by lab

These are counts before we switched over to the 2.0 pipeline










::: {#tbl-labcount2 .cell tbl-cap='Count of sequences by lab and status during the sequencing pipeline 1.0 phase'}

```{.r .cell-code .hidden}
#| label: tbl-labcount2
#| tbl-cap: "Count of sequences by lab and status during the sequencing pipeline 1.0 phase"
(count_by_lab <- wdrs_seq %>%
  filter(CASE_CREATE_DATE < '2023-04-01') %>%
  count(SEQUENCE_LAB) %>%
  arrange(desc(n)) %>%
  summarize(
    n,
    x_scaled = n / nrow(wdrs_seq) * 100,
    .by = SEQUENCE_LAB
  ) %>%
  gt() %>%
  gt_plt_bar_pct(
    column = x_scaled,
    scaled = TRUE,
    labels = TRUE,
    font_size = "12px",
    fill = "#CBC3E3"
  ) %>%
  tab_header(title = md("Number of Sequences by Lab"),
             subtitle = md("Before 2023-06-01 switch to 2.0 pipeline")) %>%
  fmt_number(
    columns = n,
    decimals = 0,
    use_seps = T
  ) %>%
  cols_label(
    SEQUENCE_LAB = 'Sequencing Lab',
    n = 'Count',
    x_scaled = 'Percent of Total Sequences'
  ) %>%
  style_table()
)
```

